import React from 'react';
import { Link } from 'react-router-dom';

const PlaylistsList = ({ url, playlists }) => {

    const renderPlaylists = Object.keys(playlists).map( playlistId => 
        <Link to = {`${url}/${playlistId}/songs`} key = {playlistId}>
            {playlists[playlistId].name}
        </Link>
    )

    return (
        <div>
            {renderPlaylists}
        </div>
    )

}

export default PlaylistsList;
